import react from 'react'
interface button {
  buttonName: string,
  buttonClass: string, 
  functionOnClick : string, 
  displayAnimation?: boolean,
  begin?: any, 
  end? : any,
  attack?: any, 
  heal? : any
}
const Button = ({
  buttonName,
  buttonClass, 
  functionOnClick,
  displayAnimation,
  begin,
  end,
  attack,
  heal
}: button) => (
  <button 
    className={`${buttonClass}-button ${buttonClass}-button--${buttonName} `}
    name={buttonName}
    onClick={(value) => !displayAnimation ?   functionOnClick : ''}
    >
      {buttonName}
    </button>
)

export default Button
